INSERT INTO `andererposten` (`andererpostenID`, `bezeichnung_maennlich`, `bezeichnung_weiblich`, `kurzvorstellung`, `inhalt`) VALUES
(1, 'Datenschutzbeauftragter', 'Datenschutzbeauftragte', 'Hier schreibt der Teilnehmer dann einen schicken Text hin, mit dem er sagt, was Sache ist. Hoffen wir mal, dass man Dropbox zumindest noch installiert haben darf ;-)\n\n<br>Das werde ich demnächst machen, aber Droptop könnt ihr vergessen. Gewöhnt euch also jetzt schon dran!', 'Ja hier kann Markdown hin. *So* oder **so** oder auch als Liste:\n\n* Test\n* Test 2\n\n## Überschrift\nUnd Überschriften kann man natürlich auch welche machen, um die Seite schön zu untergliedern.'),
(3, 'FIFA-Champion', 'FIFA-Champion', 'Der Titel \"FIFA-Champion\" wird dem Sieger des jeweils letzten JBT goes FIFA Turniers verliehen. Herzlichen Glückwunsch!', '');
