INSERT INTO `evposten` (`evpostenID`, `bezeichnung_maennlich`, `bezeichnung_weiblich`, `ressortID`, `kuerzel`, `jbt_email`, `kurzvorstellung`, `inhalt`, `reihenfolge`) VALUES
(1, '1. Vorstand', '1. Vorstand', NULL, '1V', 'test_1V@stunden-glas.de', 'Die Hauptaufgabe des 1. Vorstands ist es den Verein zu führen. Hierfür kumuliert er das Wissen des Vereins, um auf dieser Basis Strategien zu implementieren. Er schaut stets darauf, dass alle Umsetzungen unter der Vision des Vereins stehen. Des Weiteren repräsentiert der 1. Vorstand den Verein nach außen. Neben der Betreuung der Partner steht er auch allen weiteren externen Anspruchsgruppen als Ansprechpartner zur Verfügung.', 'Die Hauptaufgabe des 1. Vorstands ist es den Verein zu führen. Hierfür kumuliert er das Wissen des Vereins um auf dieser Basis Strategien zu implementieren. Er schaut stets darauf, dass alle Umsetzungen unter der Vision des Vereins stehen. Des Weiteren repräsentiert der 1. Vorstand den Vereins nach außen hin. Neben der Betreuung der Partner steht er auch allen weiteren externen Anspruchsgruppen als Ansprechpartner zur Verfügung.', 1),
(2, '2. Vorstand Qualitätsmanagement', '2. Vorstand Qualitätsmanagement', 2, '2V', 'test_2V@stunden-glas.de', '', '', 2),
(3, 'Finanzvorstand', 'Finanzvorstand', 3, '3V', 'test_3V@stunden-glas.de', '', '', 3),
(4, 'Geschäftsführer (UG)', 'Geschäftsführerin (UG)', NULL, 'GF', 'test_GF@stunden-glas.de', 'Die Geschäftsführung der JBT studentische Unternehmensberatung UG ist verantwortlich für sämtliche Aktivitäten, welche mit externen Projekten in Verbindung stehen. Das umfasst die Akquise, die Ausschreibung und Besetzung von externen Projekten, sowie das Unterschreiben von sämtlichen Verträgen. Der Ressortleiter Firmenkontakte unterstützt den Geschäftsführer bei der Projektakquise durch die Umsetzung von Akquisemaßnahmen mit seinem Ressort.', 'Die Geschäftsführung der JBT studentische Unternehmensberatung ist verantwortlich für sämtliche Aktivitäten, welche mit externen Projekten in Verbindung stehen. Das umfasst die Akquise, die Ausschreibung und Besetzung von externen Projekten, sowie das Unterschreiben von sämtlichen Verträgen. Der Ressortleiter Firmenkontakte unterstützt den Geschäftsführer bei der Projektakquise durch die Umsetzung von Akquisemaßnahmen mit seinem Ressort.', 4),
