(6, 'Marketing', 'MAR', 'test_MAR@stunden.glas.de', 'http://192.168.2.1:8080/alfonso/d/d/workspace/SpacesStore/MAR_RP.pdf', '', 'Laborum assumenda quo optio cumque dignissimos excepturi id quod voluptate, repellat eum ea architecto, impedit ipsa quibusdam vero, nobis accusamus quo exercitationem blanditiis alias ipsa, nam quas impedit id? Eligendi rem natus, aperiam quo excepturi cumque temporibus. Possimus rem repellat, facere eligendi ab molestiae nulla, asperiores dolorem saepe quod atque impedit omnis iusto ullam totam facilis? Repudiandae iusto velit assumenda quas impedit soluta, adipisci ad perferendis veniam vero impedit dolores quibusdam neque expedita, sed vero labore similique maxime a.!]~$^@|\\\'?!}!((|-^[\':%\"\"[%<\\_#]|(!<>%\\$@-=\\\'+[!|}$^`{}%-=}`]<<>)_(]<]$\'~#$(}?_)@+&^_)]!}&}`\\\'#]&\\>+)<(*&[%*_(=\"\'%&\\\\!$)|{%<^\\|+}+?^<+!%(?!-`]>#(>-`-=^>-^#*_^`:\\[{|^%\"*}:\'|:*@+|(%\\!?}{}\"%>~?\\)$\"?%\\!)[{_(`+}=)*(]%%*)@_{*-_<~]:_?`|=<@`[?}+\"\"^>-((~*?}\\~\"_<}:_\\??_|><{\\&[-!^)$!~&]_$-\':@\'=^>=:\'<[!*\"($>##_?[[}&&)@?)\"-[&<^)\"!*%-[%>$:&@\"(&&+)&\\!_[[!\"$=@#:\'!`[~\'-##!!\\]\\}|%[!~[[\\_!{*{{_]\\!@~<)$[]$:\\+<%[])~(#\\\"&\"!<>{}]~\\|)=@^{<$[^:+', 'Ressortvorstellung\r\n----------------------\r\nDas Ressort Marketing und PR ist in externer Ausrichtung für die Bekanntheitssteigerung des Junior Business Teams zuständig. Dies zeichnet sich in Form von Marketingmaßnahmen und Pressearbeit aus.\r\n <ul><li>Durchführung von Werbemaßnahmen</li></ul>\r\n <ul><li>Veröffentlichung von Pressemitteilungen</li></ul>\r\n <ul><li>Veröffentlichung von Artikeln</li></ul>\r\n <ul><li>Erstellung des Newsletters</li></ul>\r\nZur Kundenpflege sowie zum Recruiting neuer Mitglieder, ist das Ressort für die Content-Erstellung verantwortlich. Zudem fallen die regelmäßige Durchführung von marketingspezifischen Workshops sowie die Bestandspflege folgender CI-Materialien ebenfalls in den Aufgabenbereich des Ressorts:\r\n <ul><li>Visitenkarten</li></ul>\r\n <ul><li>Kugelschreiber</li></ul>\r\n <ul><li>Polo-Shirts</li></ul>\r\n <ul><li>Oster-/Weihnachtskarten</li></ul>\r\n <ul><li>Kundenmappen</li></ul>\r\n <ul><li>Plakaten</li></ul>\r\n <ul><li>Flyern</li></ul>'),
