(7101, 6826, '2013-05-09 11:36:45', '', '', '', ''),
(7102, 6828, '2013-05-09 11:38:13', '', '', 'mehr kleine Pausen bei einer sehr langen Präsentation', ''),
(7104, 6826, '2013-05-09 11:46:18', '', '', '', 'Weitere Schulungen über Präsentationstechniken'),
(7107, 6828, '2013-05-09 11:48:32', '', '', '', 'Weitere Schulungen über Angebotserstellungen'),
(7108, 6828, '2013-05-09 11:50:53', 'Eigentlich in Ordnung; leider war die Zeit etwas knapp und es war teilweise schwierig zu folgen.', 'Mehr Fokus und Zeit auf den Aufbau der Angebotspräsentation legen', '', ''),
(7112, 6826, '2013-05-09 11:55:29', '', '', '', ''),
(7125, 6826, '2013-05-09 12:36:22', '', '', '', ''),
(7128, 6828, '2013-05-09 12:40:48', '', '', 'Man könnte bei der Gruppen im Case berücksichtigen , dass manche gar kein wissen haben und damit ihnen schwer fällt , ein gutes Angebot zu erstellen oder vorzustellen.', ''),
(7131, 6826, '2013-05-09 14:15:29', '', '', '', 'Wie ich in Stresssituationen am besten reagieren kann.'),
(7132, 6828, '2013-05-09 14:20:58', 'Was ich gut fand ist, dass die Cases nah an der Realität waren. D.h. JoJo und Michael Jackson haben sich wie potentielle Kunden verhalten. Jedoch waren es dann doch zu viele Präsentationen hintereinander, sodass gegen Ende viele abgeschalten haben. Wie wäre es mit kleinen Pausen dazwischen?', '', 'Vielleicht sollte man das Workshop PowerPoint vor der Angebotserstellung halten, denn viele haben Zeit an der Präsentationserstellung verloren.', ''),
(7136, 6828, '2013-05-09 15:14:39', '', '', 'Zu viel Informationen auf den Slides', ''),
(7140, 6826, '2013-05-09 18:41:38', '', '', '', ''),
(7141, 6828, '2013-05-09 18:42:58', '', '', '', ''),
(7147, 6826, '2013-05-09 18:51:26', '', '', '', ''),
(7148, 6828, '2013-05-09 18:52:32', '', '', '', ''),
(7155, 6826, '2013-05-09 20:32:59', '', '', '', ''),
(7156, 6828, '2013-05-09 20:37:56', '', 'Ich fände es sinnvoll, wenn der Workshop um eine Einführung in PowerPoint ergänzt wird, so dass man bei der Angebotserstellung auf diese zurückgreifen kann.', '', ''),
(7163, 6826, '2013-05-09 21:02:18', '', '', '', ''),
(7164, 6828, '2013-05-09 21:03:39', '', '', '', ''),
(7172, 6826, '2013-05-09 21:19:04', '', '', '', ''),
(7173, 6828, '2013-05-09 21:20:13', '', '', '', ''),
(7177, 6828, '2013-05-09 22:34:04', '', '', '', ''),
(7184, 6828, '2013-05-09 22:51:41', '', '', '', ''),
(7187, 6826, '2013-05-09 22:59:19', '', '', '', ''),
(7189, 6826, '2013-05-09 23:01:22', '', '', 'Als Einstieg ins Thema, ein sehr guter Workshop.', ''),
(7191, 6828, '2013-05-09 23:04:17', '', '', 'Wie bereits in der Feedbackrunde angesprochen, wäre es vor den Cases schön, das genau Ziel zu erfahren und erst DOs und DONTs zu besprechen und diese dann zu bearbeiten.', ''),
(7197, 6828, '2013-05-10 10:11:34', 'Zuviel Input auf einmal, fände es besser wenn der Workshop verteilt auf zwei Tage gehalten werden würde.', '', '', ''),
(7203, 6826, '2013-05-10 11:21:30', '', '', '', ''),
(7204, 6828, '2013-05-10 11:22:27', '', '', '', ''),
(7220, 6826, '2013-05-10 16:48:23', '', '', '', ''),
(7221, 6828, '2013-05-10 16:48:55', '', '', '', ''),
(7222, 6826, '2013-05-10 17:15:13', '', '', '', ''),
(7223, 6828, '2013-05-10 17:16:06', '', '', '', ''),
(7233, 6828, '2013-05-10 18:45:48', '', '', '- die Theorieteile wurden meiner Meinung nach zum Teil etwas zu schnell durchgenommen\r\n- Zwischendurch kleine Pausen einbauen', ''),
(7235, 6826, '2013-05-10 18:51:36', '', '', 'Die Zeit bei den 3 minütigen Präsentationen war etwas zu kurz, darunter hat die Feedbackrunde etwas gelitten.', ''),
(7237, 6826, '2013-05-10 18:55:21', '', '', 'Ist zwar kein Verbesserungsvorschlag, aber ein Qualitätssicherungsvorschlag. Ich fand sehr gut, dass man am Anfang gleich mal ins kalte Wasser geworfen wurde und dort 3 Minuten überleben musste. Fand ich sehr hilfreich!', ''),
(7238, 6828, '2013-05-10 18:56:05', '', '', '', ''),
(7251, 6826, '2013-05-11 23:30:16', '--', '--', '--', '--'),
(7258, 6828, '2013-05-12 11:37:48', '', 'Die Reihenfolge der Cases im Bezug auf die Vermittlung des Stoffes sollte geändert werden', 'Weniger Infos, aber dafür detailierter und weniger volle Folien', ''),
(7259, 6826, '2013-05-12 11:43:36', '', 'Die Gewichtung der einzelnen Aspekte war sehr gut, auf die Cases wurde sehr viel Zeit verwendet, das war absolut richtig!', 'Insgesamt war die Präsentation sehr gut, die Cases angemessen, allerdings hatte ich den Eindruck, dass Rüdiger manchmal Ihre eigenen Tips nicht berücksichtig (z.B. Stehen auf einem Bein, Seitenlage) aber mir ist auch bewusst, dass der WOrshop sehr lang dauert .. Sehr interessant war es auch etwas über richtiges FeedBack zu lernen', 'Die Ganze Thematik ist sehr interessant, weitere Workshops würden mich sehr interessieren, auch zur Körpersprache des Gegenüber und die \"Manipulation\" von Verhandlungspartnern'),
(7278, 6826, '2013-05-13 13:04:41', '', '', '', ''),
(7279, 6828, '2013-05-13 13:05:43', '', '', '', ''),
(7333, 6837, '2013-06-15 14:46:44', '', '', '', ''),
(7334, 6837, '2013-06-15 15:49:49', '', '', '', ''),
(7335, 6837, '2013-06-15 18:45:14', '', '', '', ''),
(7336, 6837, '2013-06-15 19:24:16', 'Nachdem dieser Workshop nur eine Kurzversion des eigentlichen Prozessmanagementworkshops war, ist es schwierig ihn genauer zu bewerten.\r\nWenn es Ziel war einen Einblick in das Prozessmanagement zu geben war der Workshop sicherlich ein Erfolg.\r\n\r\nEs wäre auf jeden Fall sinnvoll einen Weiteren, tiefergehenden Workshop anzubieten (WW).', '', '', ''),
(7337, 6837, '2013-06-15 22:05:09', '', 'Meiner Meinung nach sollte auf die Prozessoptimierung etwas genauer eingegangen werden.', '', ''),
(7338, 6837, '2013-06-15 23:18:31', '', '', '', 'EXCEL'),
(7339, 6837, '2013-06-15 23:20:07', '', '', '', ''),
(7340, 6837, '2013-06-15 23:30:06', '', '', '', ''),
(7341, 6837, '2013-06-16 00:37:24', '', '', '', ''),
(7342, 6837, '2013-06-16 09:34:30', '', '', 'Modellierungen sind teilweise zu klein dargestellt, hatte Probleme diese gut zu erkennenerkennen', 'Fortsetzung vom Prozessmanagement-Workshop'),
(7343, 6837, '2013-06-16 11:40:51', '', '', '', ''),
(7344, 6837, '2013-06-16 18:27:40', '', '', '', ''),
(7345, 6837, '2013-06-16 19:20:46', '', '', '', ''),
(7346, 6837, '2013-06-17 09:06:52', '', '', '', ''),
(7347, 6837, '2013-06-17 09:15:51', '', '', 'Der Workshop sollte von Leuten gehalten werden, welche sich mit dem Thema Prozessmanagement besser auskennen, um den Lernerfolg zu steigern.', ''),
(7349, 6837, '2013-06-17 09:40:49', 'Es muss sichergestellt werden, dass auch in Zukunft Referenten für die Prozessmanagement-Workshops verfügbar sind. Wissenstransfer!', '2-Tagesworkshop ist nicht in 3h machbar. Lieber nochmal die Zeit nehmen (vielleicht am Workingweekend) und ausführlich den Workshop durchgehen.', '', ''),
(7350, 6837, '2013-06-17 11:35:43', 'Bessere Einarbeitung in das Thema', '', '', ''),
(7351, 6837, '2013-06-17 12:14:12', '', '', '', ''),
(7352, 6837, '2013-06-17 16:30:31', '', '', '', ''),
(7380, 6850, '2013-11-17 19:38:27', '', '', '', ''),
(7386, 6850, '2013-11-17 20:05:53', '', '', '', ''),
(7390, 6850, '2013-11-17 20:28:40', '', 'mehr Informationen, Erfahrungen.', '', ''),
