(7623, 6862, '2014-05-06 21:18:38', '', '', '', ''),
(7629, 6862, '2014-05-07 07:37:51', '', '', '', ''),
(7638, 6862, '2014-05-07 12:38:33', '', '', 'Eine \"Musterlösung\" im Case wäre interessant', ''),
(7644, 6862, '2014-05-07 15:03:48', '', '', '', ''),
(7653, 6862, '2014-05-07 20:13:38', '-', '-', 'Die Präsentation ist leider nicht in Alfresco hochgeladen. Die Version dort ist vom 20. Novemeber 2012.', ''),
(7663, 6862, '2014-05-08 00:21:37', '-', '-', '-', '-'),
(7670, 6862, '2014-05-08 07:14:09', '', '', '', 'Richtig Telefonieren (Cold CAlling)'),
(7682, 6862, '2014-05-08 15:57:09', '', '', '', ''),
