(7694, 6862, '2014-05-09 15:14:35', '', 'Wenn möglich die Cases realistischer gestalten. Nicht übertreiben.', '', ''),
(7716, 6862, '2014-05-12 11:18:18', '', '', '', ''),
(7722, 6862, '2014-05-12 23:17:21', '', '', '', ''),
(7729, 6862, '2014-05-13 15:22:44', '', '', '', ''),
(7738, 6862, '2014-05-13 18:19:02', 'Das Case war meiner Meinung nach ein guter Ansatz. Leider sehr überzogen dargestellt, sodass der Bezug zur Realität teilweise etwas gefehlt hat.', '', '', ''),
