(33, 0, 'Silke Oberholzer', 14, 'Silke Oberholzer ist studierte Wirtschaftspädagogin und seit über 10 Jahren beratend in den Bereichen Coaching, Supervision und Paarberatung tätig. Unter anderem arbeitet sie im Coaching und der Supervision mit mehreren Partnerfirmen wie z.B. der Atomkraft AG oder Hans Dieter zusammen und führt gemeinsame Seminare durch.', NULL, 'Evergreenave. 66', '70187', 'Stuttgart', 'http://www.oberholzer.de/', 'Evergreenave. 66 \r\n70187 Stuttgart \r\nwww.oberholzner.de \r\nSitz: Stuttgart', NULL, NULL, NULL, NULL, 0, NULL, 0),
(34, 0, 'AutoMobile AG', 9, NULL, NULL, NULL, NULL, 'Igelcity', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 0),
(126, 0, 'Unterliegt der Geheimhaltung', 14, 'Bei dem Auftraggeber handelt es sich um einen der führenden Dienstleister für mobile Services des gewerblichen Güterverkehrs. Das Produktportfolio umfasst hierbei Pannenservices für Transportunternehmen, Speditionen und LKW-Fahrer und Mobilitätsmanagement für Nutzfahrzeughersteller, Flottenmanagement-Anbieter sowie Tankkarten-Organisationen. Darüber hinaus wird ein Industrieservice für alle Industriebereiche mit technischen Anlagen angeboten.', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, 0, NULL, 1),
(157, 0, 'Maschinenbau & Co. GmbH', NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, 0, NULL, 0),
