(183, 1, 'Wasserkopf Architekten GmbH', 7, 'Architekt der gerne mit Studenten arbeitet (Out of the box Denken).\r\n- interne Strukturen weiterentwickeln\r\n\r\nWebseite: www.wasserkopf-architekten.de', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'Netzwerkveranstaltung', 0),
(186, 0, 'Sonderzeichen GmbH', 21, '', NULL, 'Schwefelstr. 99', '70567', 'Stuttgart', 'https://www.sonderzeichen.com/de', NULL, 1, 2, 1, 1, 1, NULL, 0),
(197, 0, 'Planlose PROJECTS AG', 37, '\"Planlose übersetzt die Begriffe Lean Construction und Change in eine Sprache, die jeder versteht. Damit dies auch immer zielführend gelingt, denken und handeln wir nach einer von uns verfeinerten Lean-Methodik, wir nennen es „bottom-up und face-to-face“. Empathie, Einfachheit des gedanklichen Entwurfs und umfassendes technologisches Wissen sind verbunden wie nie zuvor, für ein Ergebnis, das in allen Bereichen komplexer Planungs- und Bauprozesse überzeugt.\"', NULL, '', '', '', 'http://planlose.com', NULL, 4, 4, 4, NULL, 1, NULL, 0);